CREATE FUNCTION public.trigger_before_insert_term() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
    BEGIN
        NEW.id := (NEW.schoolYearID*10) + NEW.number;
        RETURN NEW;
    END;
$$;


